import React from 'react';
import xImg from '../../x.png'; 

function LoginPage() {
  return (
    <div className = 'container'>
            <div className = 'x-box'>
                <img src = {xImg} className='x-img' /> 
            </div>
            <div className = 'login-box'>
                <h1 className='ft-big'>로그인</h1>
                <p className='ft-small'>아이디</p>
                <input className = 'text-box' type='text'></input>
                <p  className='ft-small'>비밀번호</p>
                <input className = 'text-box' type='password'></input>
                <button className = 'orange-btn'>로그인</button>
            </div>


    </div>
  );
}

export default LoginPage;
